import './index.css';
import Header from './components/header';
import pages from './components/header.js';
import Footer from './components/footer'
import Dashboard from './components/dashboard';
import {
  BrowserRouter,
  Routes,
  Route,
  Link,
  Outlet
} from "react-router-dom";

var page = pages.pagecurrent
var Page_link = Dashboard
function App() {
  if (page = "home") {
    Page_link = Dashboard
  } else if (page = "timetable") {
    Page_link = Footer
  }
  return (
    <div className='App'>
      <Header />
      <main>
        <BrowserRouter>
          <Routes>
            <Route exact path="/" element={Footer} />
          </Routes>
        </BrowserRouter>
        <Page_link />
      </main>
      <Footer />
    </div>
  );
}



export default App;
